bool moverjuego(int mapa[FILAS][COLUMNAS],int velocidad,int& scoreacumulado,int nivel){
	OcultarCursor();
	int x=995;
	int y=39;
	char a=219;
	int temporizador;
	char tecla;
	int contadordepasos=0;
	bool enemigo;
	srand(time(NULL));
    for(int i=999;i>=0;i--){
  	for(int j=0;j<80;j++){
  		if(mapa[i][j]==8)mapa[i][j]=1;
  		gotoxy(i,j);
  		switch(mapa[i][j]){
  			
  			case 0:SetColor(2); cout << a; break;//Verde
			case 1:SetColor(1); cout << a; break;//azul
			case 2:SetColor(3); cout << a; break;
			case 3:SetColor(4); cout << a; break;
			case 4:SetColor(5); cout << a; break;
			case 5:SetColor(6); cout << a; break;//amarillo
		  }
		  		
  		}
	  }
	  dibujarpersonaje(x,y);
	  gotoxy(x+10,0);
	  //mostrarscore(x+3,82,scoreacumulado);
	  contadordepasos=0;
	  system("pause>NULL");
	do{
	
		
        if(kbhit()){
		  		tecla=_getch();
		  			switch(tecla){

						case IZQUIERDA:
						case 'A':
						case FLECHAIZQUIERDA:{ 
					    	borrarpersonaje(x,y);	y--;
	  	   	                dibujarpersonaje(x,y);  
						 if(validarmapa(x,y-1,mapa)||validarmapa(x+1,y-2,mapa)||validarmapa(x-1,y,mapa)){
						 	 PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	 Sleep(3000);
						 	return false; 
						  }
						  	Sleep(0.2*(velocidad+35));
						  break; }
				    	case ARRIBA:
						case 'W':
						case FLECHAARRIBA:{ 
							
				    		borrarpersonaje(x,y);
				    	    borrarscore(x-26,82,scoreacumulado);
						    	x--;			    	
					     	
							gotoxy(x-26,0);
	  	   	                dibujarpersonaje(x,y);   mostrarscore(x-26,82,scoreacumulado);
	  	   	            	
	  	   	            	scoreacumulado=scoreacumulado+nivel;
	  	   	            	contadordepasos++;
							if(validarmapa(x-1,y,mapa)||validarmapa(x,y+1,mapa)||validarmapa(x,y-1,mapa)||validarmapa(x+1,y-2,mapa)||validarmapa(x+1,y+2,mapa)){
								PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	 	Sleep(3000);
								return false;
							}	Sleep(0.2*velocidad);
							if(contadordepasos%75==0){
								int a;
								do{
								a=rand()%81;
								}while(mapa[x-22][a]!=1);dibujarenemigo(x-22,a,mapa);
							}
						  break; }
	
						case DERECHA:
						case 'D':
						case FLECHADERECHA:{ 	
						borrarpersonaje(x,y);	y++;
	  	   	            dibujarpersonaje(x,y);	
					    if(validarmapa(x,y+1,mapa)||validarmapa(x+1,y+2,mapa)||validarmapa(x-1,y,mapa)){
					    	PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	Sleep(3000);
					    	return false;
						}
	  	   	           	Sleep(0.2*(velocidad+35));
						 break; }
						 
						 
						 
						 case ABAJO:
						 case 'S':
						 case FLECHAABAJO:{ 
						 	
						 	if(x<997){
								if(velocidad>50){
								
								borrarpersonaje(x,y);	
								borrarscore(x-26,82,scoreacumulado); 	
								x++;gotoxy(x+3,0);
								mostrarscore(x-26,82,scoreacumulado);
			  	   	            dibujarpersonaje(x,y);
							    
							    
								if(validarmapa(x+1,y-2,mapa)||validarmapa(x+1,y+2,mapa)||validarmapa(x+3,y-1,mapa)||validarmapa(x+3,y+1,mapa)){
								PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	 	Sleep(3000);
								return false;
									}	Sleep(0.2*velocidad);
								}
		  	   	              }
						 break; 
					     }
					    case ' ':{
					    	if(x>11){
					    	borrarpersonaje(x,y);
				    	    borrarscore(x-26,82,scoreacumulado);
						    	x-=8;			    	
					     	
							gotoxy(x-26,0);
	  	   	                dibujarpersonaje(x,y);   mostrarscore(x-26,82,scoreacumulado);
	  	   	            	
	  	   	            	scoreacumulado=scoreacumulado+(nivel*7);
	  	   	            	contadordepasos+=7;
							if(validarmapa(x-1,y,mapa)||validarmapa(x,y+1,mapa)||validarmapa(x,y-1,mapa)||validarmapa(x+1,y-2,mapa)||validarmapa(x+1,y+2,mapa)){
								PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	 	Sleep(3000);
								return false;
							}	Sleep(0.2*velocidad);
							}
							break;
						}
					    case 'p':
						{
					    	system("PAUSE > NULL");
							break;
						}
						case 'z':
						case 'Z':{
							borrarpersonaje(x,y);	y-=2;
	  	   	                dibujarpersonaje(x,y);  
						 if(validarmapa(x,y-1,mapa)||validarmapa(x+1,y-2,mapa)||validarmapa(x-1,y,mapa)){
						 	PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	 Sleep(3000);
							 return false; 
						  }
						  	Sleep(0.2*velocidad);
						  break; }
							break;
						
						case 'c':
						case 'C':{
							borrarpersonaje(x,y);	y+=2;
	  	   	                dibujarpersonaje(x,y);	
						    if(validarmapa(x,y+1,mapa)||validarmapa(x+1,y+2,mapa)||validarmapa(x-1,y,mapa)){
						    	PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	 Sleep(3000);
								return false;
							}
		  	   	           	Sleep(0.2*velocidad);
							break;
						}
					}

				}
			else{
			
						
						borrarpersonaje(x,y);
				 	    borrarscore(x-26,82,scoreacumulado);
				     	x--;gotoxy(x-26,0);
				     	mostrarscore(x-26,82,scoreacumulado);
  	   	                dibujarpersonaje(x,y);   
  	   	            	
						Sleep(velocidad);	
						scoreacumulado=scoreacumulado+nivel;
						contadordepasos++;
						if(validarmapa(x-1,y,mapa)||validarmapa(x,y+1,mapa)||validarmapa(x,y-1,mapa)||validarmapa(x+1,y-2,mapa)||validarmapa(x+1,y+2,mapa)){
							PlaySound("explotion.wav", NULL, SND_FILENAME|SND_LOOP|SND_ASYNC);
						 	 Sleep(3000);
							return false;
						}
						if(contadordepasos%75==0){
							int a;
							do{
							a=rand()%81;
							}while(mapa[x-22][a]!=1);dibujarenemigo(x-22,a,mapa);
						}
				
			}
			
		}while(x>1);
		return true;			  
}

